import { Component } from "react";

const styles = {
    navbar:{
        backgroundColor:'#0A283E',
        height:'100px',
        display:'flex',
        flexDirection:'row',
        alignItems:'center',
        justifyContent:'space-between',
        position:'relative',
        padding:'0 50px'
    }
}

class Navbar extends Component{
    render(){
        return(
            <nav style={styles.navbar}>
                <p>Logo</p>
                <p>Carro</p>
            </nav>
        )
    }
}

export default Navbar
